import { Link } from "react-router-dom";

const Navbar = () => {
    return ( 

        <nav className="navbar">
            <h1>Student App</h1>
            <div className="links">
                <Link to='/'>Home</Link>
                <Link href='/create'>New User</Link>
            </div>
        </nav>
     );
}
 
export default Navbar;
